import React from 'react'
import SuggestedJobs from "./SuggestedJobs";
import JobTitles from "./JobTitles";
import FastSearch from './FastSearch';
import JobList from './layouts/JobList';




export default function Dashboard() {
  return (
    <div>
      <SuggestedJobs />
      <JobTitles />
      <FastSearch />
      <JobList />



    </div>
  )
}
